import { combineReducers } from 'redux'
import listArticlesReducer from "./listArticlesReducer"
import navbarReducer from "./navbarReducer"

const rootReducer = combineReducers({
  countReducer,
  listArticlesReducer,
  navbarReducer
});

export default rootReducer

